export default function Students(props) {
    const StudentsList = lazy(()=>import('./StudentsList'))
    const AddStudents = lazy(()=>import('./AddStudents'))
    const UploadStudents = lazy(()=>import('./StudentsList'))
    return(
        <div className="students_content" >

            <SubNav urls={studentsNav} />
            
            <div>students content</div>

        </div>
    )
}
